i = data_ei['Ei']\n    // var Ep = data_ep['Ep']\n\n    // vars from callback:\n    var Txx = Txx.value;\n    var Txy = Txy.value;\n    var Tyy = Tyy.value;\n    var Tm = (Txx+Tyy)/2;\n\n    // Set phi = 0, if any spinner is used:\n    var Txx_tmp = data_al['Txx_tmp'];\n    var Txy_tmp = data_al['Txy_tmp'];\n    var Tyy_tmp = data_al['Tyy_tmp'];\n    if ( Txx != Txx_tmp || Txy != Txy_tmp || Tyy != Tyy_tmp ){\n        Txx_tmp[0]=Txx;\n        Txy_tmp[0]=Txy;\n        Tyy_tmp[0]=Tyy;\n        phi.value=0;\n        \n    }\n\n    var phi = phi.value;\n\n    // Multiline cyan:\n    var C = data_ml['C'];\n    var S = data_ml['S'];\n    var X = data_ml['X'];\n    var Y = data_ml['Y'];\n    var XS = data_ml['XS'];\n    var YS = data_ml['YS'];\n\n    // Little Circle black:\n    var x = data_al['x']\n    var y = data_al['y']\n    var xm = data_al['xm']\n    var ym = data_al['ym']\n\n    // label at little circle:\n    var x_lbl = data_lb['x']\n    var y_lbl = data_lb['y']\n\n    // CS green:\n    var EX = data_al['EX']\n    var EY = data_al['EY']\n\n    // CS blue:\n    var ex = data_al['ex']\n    var ey = data_al['ey']\n\n    // Eigen:\n    var evx = data_al['evx']\n    var evy = data_al['evy']\n    var phi1 = data_al['phi1']\n    var phi1deg = data_al['phi1deg']\n    var start = data_al['start']\n    var end = data_al['end']\n    var start_X = data_al['start_X']\n    var end_X = data_al['end_X']\n    var minx = data_al['minx']\n    var maxx = data_al['maxx']\n\n    // AnnularWedge blue:\n    var xa = data_al['xa']\n    var ya = data_al['ya']\n    var pa = data_al['pa']\n    var pad = data_al['pad']\n    var pad2 = data_al['pad2']\n    var px = data_al['px']\n\n    // red:\n    var outer_radius = data_al['outer_radius']\n    var inner_radius = data_al['inner_radius']\n    var start_angle = data_al['start_angle']\n    var end_angle = data_al['end_angle']\n\n\n    if ( phi &gt;= 0.0 ){\n        var start_angle = data_al['start_angle']\n        var end_angle = data_al['end_angle']\n    }\n    else {\n        var start_angle = data_al['end_angle']\n        var end_angle = data_al['start_angle']\n    }\n\n    // -----------------------------------------\n    // -----------------------------------------\n    // -----------------------------------------\n\n    // Multiline cyan:\n    for (var i = 0; i &lt; C.length; i++) {\n        X[i] =   Tm + (Txx - Tyy)*C[i]/2 + Txy*S[i];\n        Y[i] =      - (Txx - Tyy)*S[i]/2 + Txy*C[i];\n    }\n    for (var i = 0; i &lt; XS.length-1; i++) {\n        XS[i] = [X[i],X[i+1]];\n        YS[i] = [Y[i],Y[i+1]];\n    }\n    var i_last = XS.length - 1;\n    XS[i_last] = [X[i_last],X[0]];\n    YS[i_last] = [Y[i_last],Y[0]];\n\n    // Little Circle black:\n    var dMP = [Txx-Tm, Txy]\n    var dMPm = [Tyy -Tm, -Txy]\n\n    phi *= Math.PI/180\n    var psi = - 2*phi\n\n    var c1 = Math.cos(psi)\n    var s1 = Math.sin(psi)\n    var Q1 = [[c1, -s1], [s1, c1]]\n\n    var c2 = Math.cos(phi)\n    var s2 = Math.sin(phi)\n    var rP = [0,0];\n    var rPm = [0,0];\n\n    for (var j = 0; j &lt; 2; j++) {\n       for (var i = 0; i &lt; 2; i++) {\n          rP[j]  += Q1[j][i]*dMP[i];\n          rPm[j] += Q1[j][i]*dMPm[i];\n       }\n    }\n    x[0] = rP[0] + Tm;\n    y[0] = rP[1];\n    xm[0] = rPm[0] + Tm;\n    ym[0] = rPm[1];\n\n    x_lbl[0] = rP[0] + Tm;\n    y_lbl[0] = rP[1];\n\n    // label below:\n    var txx = x[0].toFixed(2);\n    var txy = y[0].toFixed(2);\n    var tmp = \"(\"\n    var tmp = tmp.concat(txx.toString());\n    var tmp = tmp.concat(\", \");\n    var tmp = tmp.concat(txy.toString());\n    var tmp = tmp.concat(\")\");\n    T[0] = tmp;\n\n    // CS blue:\n    outer_radius[0] = Math.sqrt((0.5*(Txx - Tyy))**2 + Txy**2);\n\n    // Eigen:\n    evx[0][0] = Tm - outer_radius[0];\n    evx[0][1] = Txx_tmp;                    \n    evx[0][2] = Tm + outer_radius[0];\n    evy[0][0] = 0;\n    evy[0][1] = Txy_tmp;                    \n    evy[0][2] = 0;\n    minx[0] = Tm - outer_radius[0];\n    maxx[0] = Tm + outer_ra      }\n\n\n    end_angle[0] = start_angle[0] - 2*phi;\n\n    var phi1 = Math.atan2(Txy,Txx);\n\n    // AnnularWedge blue:\n    if ( phi &gt;= 0.0 ){\n        pa[0] = phi;\n        px[0] = 0.;\n        pad[0] = phi*180./Math.PI;\n        pad2[0] = 2*pad[0]\n    }\n    else {\n        px[0] = phi;\n        pa[0] = 0.;\n        pad[0] = phi*180./Math.PI;\n        pad2[0] = 2*pad[0]\n    }\n\n    if (flipped==1){\n        px[0] = px[0] + Math.PI;\n        pa[0] = pa[0] + Math.PI;\n    }\n\n    src_al.change.emit();\n    src_ml.change.emit();\n    src_lb.change.emit();\n    // src_ei.change.emit();\n    // src_ep.change.emit();\n\n"}}]]]},"width":100,"title":"Txx","value":-1.2,"step":0.1}}]}},{"type":"object","name":"Row","id":"4c474134-f93d-420c-990c-7977936f54b3","attributes":{"sizing_mode":"stretch_width","children":[{"id":"8c58e0b7-e0d7-42f9-a4d3-945f54f3573f"}]}},{"type":"object","name":"Row","id":"2350df42-1755-4c58-ab3d-f57993461b45","attributes":{"sizing_mode":"stretch_width","children":[{"id":"7c3493bd-d39c-4fa6-916c-ebd9dd79ff11"}]}},{"type":"object","name":"Row","id":"bf4931c3-8569-4ae1-baec-6807ce641656","attributes":{"sizing_mode":"stretch_width","children":[{"id":"eaba6c60-4b70-46aa-8f3c-3054b2e1a648"}]}},{"type":"object","name":"Row","id":"4c08f91d-8e1f-4e34-bf83-65384e6cea79","attributes":{"sizing_mode":"stretch_width","children":[{"type":"object","name":"CheckboxGroup","id":"6005e9d3-084c-4b47-bd19-4d5de56ac174","attributes":{"js_property_callbacks":{"type":"map","entries":[["change:active",[{"type":"object","name":"CustomJS","id":"f3d77783-8f29-402d-9610-3199478de803","attributes":{"args":{"type":"map","entries":[["src_al",{"id":"017b18b8-fea1-4efd-8631-3d801a5a71c4"}]]},"code":"\n    var data_al = src_al.data;\n    var a0 = data_al[\"alpha_0\"]                   \n    var a1 = data_al[\"alpha_1\"]                   \n    var a2 = data_al[\"alpha_2\"]                   \n    var a3 = data_al[\"alpha_3\"]                   \n\n    console.log('cb: ' + t
